import React from 'react';

const AboutMe = () => {
  return (
    <div className="container">
      <h1>About Me</h1>
      <p>Hello! I'm Pranav, a passionate React Developer. I have experience in various technologies and love creating innovative solutions to complex problems.</p>
      <p>More details about you, your background, and your interests.</p>
    </div>
  );
}

export default AboutMe;
